Who doesn’t love a good flat lay? 

This post is inspired by my ‘Things I Like’ IG stories (if you haven’t seen them they’re all saved in my highlights) where I like to highlight some of my favourite finds, usually from small brands, and share my discoveries with you. I sometimes group them with a theme, it could be anything from the very generic like colour and clothing type to very niche, but they can also be a mix of everything, go check them out, if you like this post you’ll love them too!

These have become so popular and I’ve had so much lovely feedback from you that I thought I’d share one on my main grid. However, instead of showing you things I’ve discovered online but haven’t seen IRL or tried myself I thought I’d show you my favourites from my own wardrobe and home for a change. This means they are all things I’ve tried, tested and approved to make it onto my all time favourite list, the very best of the best and I’ve grouped and themed them for each slide so you’re bound to find something you love ❤️ 

Enjoy and let me know if you find a new brand or product you’d like to try too! If you have any questions about anything you see don’t be shy ☺️ 

